/* 
注册用户展示页
*/ 
import React from 'react';
import { Button,Table } from 'antd';
import type { TableColumnsType } from 'antd';
import { useNavigate } from "react-router-dom";
interface DataType {
  key: React.Key;
  name: string;
  age: number;
  address: string;
}
const columns: TableColumnsType<DataType> = [
  {
    title: '姓名',
    width: 100,
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: '年龄',
    width: 100,
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: '手机号',
    dataIndex: 'phone',
    key: 'phone',
    width: 150,
  },
  {
    title: '邮箱',
    dataIndex: 'email',
    key: 'email',
    width: 150,
  },
  {
    title: '性别',
    dataIndex: 'sex',
    key: 'sex',
    width: 150,
  },
  {
    title: 'Action',
    key: 'operation',
    fixed: 'right',
    width: 100,
    render: () => <a>action</a>,
  },
];

const data: DataType[] = [];
// 数据源
for (let i = 0; i < 100; i++) {
  data.push({
    key: i,
    name: `Edward ${i}`,
    age: 32,
    address: `London Park no. ${i}`,
  });
}
// 新增注册
const handleAdd = () => {
    console.log('注册用户');
    navigate("/SignForm");
    
}
const SignupTable: React.FC = () => (
    <>
        <Button onClick={handleAdd} type="primary" style={{ marginBottom: 16 }}>
        注册用户
      </Button>
  <Table columns={columns} dataSource={data} scroll={{ x: 1500, y: 300 }} />

    </>);

export default SignupTable;
